import React, { Component } from "react";
import "bootstrap/dist/css/bootstrap.min.css";
import "./App.css";

import AddSongData from "./components/add-songdata.component";
import SongData from "./components/songdata.component";
import SongDataList from "./components/songdatas-list.component";

class App extends Component {
    render() {
        return (
            <div>
                <nav className="navbar navbar-expand navbar-dark bg-dark">
                    <a href="/songdatas" className="navbar-brand">
                        bezKoder
                    </a>
                    <div className="navbar-nav mr-auto">
                        <li className="nav-item">
                            <Link to={"/songdatas"} className="nav-link">
                                SongData
                            </Link>
                        </li>
                        <li className="nav-item">
                            <Link to={"/add"} className="nav-link">
                                Add
                            </Link>
                        </li>
                    </div>
                </nav>
                <div className="container mt-3">
                    <Switch>
                        <Route exact path={["/", "/songdatas"]} component={SongDataList} />
                        <Route exact path="/add" component={AddSongData} />
                        <Route path="/songdatas/:id" component={SongData} />
                    </Switch>
                </div>
            </div>
        );
    }
}
export default App;
